import './assets/css/App.css';
import './assets/css/bootstrap.min.css'
import ProfilePic from './assets/images/portrait_pic.jpeg'

function App() {
  return (

    <div className="container mt-2">

      {/* profile card */}
      <div className="shadow-lg card border_color">
        <div className="card-body text-center">
          <img className="rounded-circle shadow-lg" src={ProfilePic} style={{ width: '125px' }}></img>
          <br />
          <ul className="list-unstyled">
            <li className="h4">Henzon Zambrano</li>
            <li className="h5">Computer Engineer</li>
            <li></li>
          </ul>
        </div>
      </div>

      <div className="row container">
        Projects
          <div className = "col"></div>

        </div>


    </div>

  );
}

export default App;
